import React from 'react';
import './styles/Profile.css';

class Profile extends React.Component{
    render(){
        return(
            <div className="container prof-con border rounded">
                <div className="left-prof-div border-end">
                    <div className="photo-and-name">
                        <img src="https://i.ytimg.com/vi/Ue1eHtvWRTU/maxresdefault.jpg" className="border border-1 border-secondary" id="profilePhoto"></img>
                        <h6>Yilmaz Gokpinar</h6>
                    </div>
                    <div id="profile-category">
                        <span><i class="fas fa-user"></i>Profil</span>
                        <span><i class="fas fa-cog"></i>Innstillinger</span>
                        <span>Meldinger</span>
                        <span>Favoritter</span>
                        <span>Mine Annonser</span>
                        <span>Lagrade Søk</span>
                        <span>Vurderinger</span>
                    </div>
                </div>
                <div className="right-prof-div">
                    <p>fj dsaş</p>
                </div>
            </div>
        )
    }
}

export default Profile;
